import "./styles.css";
import  data from "./demo-data.json";

export default function App() {
  const Key = ({ property }: { property: string }) => {
    return <span className="clickable-property key">{`${property}: `}</span>;
  };

  const iterateObject = (object: any) => {
    return Object.keys(object).map((key) => {
      console.log(object[key], typeof object[key]);

      switch (typeof object[key]) {
        case "string":
          return (
            <div key={key}>
              <Key property={key} />
              {`\'${object[key]}\',`}
            </div>
          );
        case "boolean":
          return <div key={key}>
            <Key property={key} />
            {`\'${object[key]}\',`}
          </div>;

        default:
          if (Array.isArray(object[key])) {
            object[key].map(elem => iterateObject(elem))
          } else {
            iterateObject(object[key])
          }
          break;
      }

      // if (typeof object[key] === "object") {
      //   return (
      //     <div key={key} className="indented">
      //       <span className="clickable-property key">{`${key}: `}</span>
      //       <div className="indented">{iterateObject(object[key])}</div>
      //     </div>
      //   );
      // } else {
      //   return (
      //     <div key={key}>
      //       <span className="clickable-property key">{`${key}: `}</span>
      //       {object[key]},
      //     </div>
      //   );
      // }
    });
  };

  return (
    <div className="App">
      <div>
        <label htmlFor="property-input">Property</label>
        <input type="text" id="property-input" />
      </div>

      <div>
        Response
        <div>{iterateObject(data)}</div>
        {/* <div>
          <pre>{JSON.stringify(data, null, 2)}</pre>
        </div>
        ;{" "} */}
      </div>
    </div>
  );
}
